import React from 'react';
import './Header.css'
import styled from 'styled-components'
import BurgerButton from '../Home/BurgerButton/BurgerButton';


const Header = () => {
    return (
        // <Router>
        <header className='header'>
            <Navbar>
                <div>
                    <a href="/">
                        <img className='logo' src="/Assets/logo.png" alt="logo" />
                    </a>
                </div>
                <ul className='links '>
                    <a href='/'>Home</a>
                    <a href='/'>About</a>
                    <a href='/'>Contact</a>
                </ul>
                <div className='burguer'>
                    <BurgerButton />
                </div>
            </Navbar>
        </header>
        // </Router>
    );
}

export default Header;

const Navbar = styled.nav`
    .logo{
        width: 50px;
        padding: 10px;
        margin-left: 10px;
        transition: width .5s;
        :hover{
            width: 60px;
        }
    }

    .links {
        a{
            margin-right: 15px;
            text-decoration: none;
            font-weight: bold;
            font-size: 20px;
            color: inherit;
            border-radius: 12px;
            transition: .5s; 

           :hover{
                background-color: black ;
                color: aliceblue;
                padding: 5px;
           }
        }
    }
    
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin: 0;
    /* .links{
        position: absolute;
        top: -1000px;
        right: -1000px;
        margin-left: auto;
        margin-right: auto;
        text-align: center;
        a{
            color: ;
        }
        @media(min-width: 768px){
        }
    }
    .links.active{
        width: 100%;
        display: block;
        position: absolute;
        margin-left: auto;
        margin-right: auto;
        top: 30%;
        left: 0;
        right: 0;
        text-align: center;
        a{
            color: white;
        }

    } */
   .burguer{
    @media(min-width: 768px){
        display: none;
    }
    
   }
`
